// fireworks //
const canvas = document.getElementById("canvas");
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
let ctx = canvas.getContext("2d");

var smokeArray = []

function SmokeCircle(x,y,radius,volX,volY,alphaValue,R,G,B){
    this.x = x;
    this.y = y;
    this.radius = radius;
    this.volX = volX;
    this.volY = volY;
    this.R = R;
    this.G = G;
    this.B = B;
    this.alphaValue = alphaValue;
    this.erase = false;

    this.draw = function(){
        ctx.beginPath();
        ctx.fillStyle = "rgba(" + this.R + ',' + this.G + ',' + this.B + ',' + this.alphaValue + ")";
        ctx.arc(this.x,this.y,this.radius,Math.PI * 2, 0, false);
        ctx.fill();
    }
    this.update = function(){

        this.alphaValue -= 0.02;
        
        if(this.alphaValue == 0 || this.alphaValue < 0){
            this.erase = true;
        }

        if(this.volX > 0){
            this.volX -= 0.1;
        } else if(this.volX < 0){
            this.volX += 0.1;
        }
        if(this.volY > 0){
            this.volY -= 0.1;
        } else if(this.volY < 0){
            this.volY += 0.1;
        }
        

        this.x += this.volX;
        this.y -= this.volY;
        this.draw();
    }
    this.update();

}

function Rocket(x,y,width,height,yVol,R,G,B){
    this.x = x;
    this.y = y;
    this.width = width;
    this.height = height;
    this.yVol = yVol;
    this.R = R;
    this.G = G;
    this.B = B;
    this.boom = false;

    this.draw = function(){
        ctx.fillStyle = "rgb(" + this.R + ',' + this.G + ',' + this.B + ")";
        ctx.fillRect(this.x,this.y,this.width,this.height);
    }
    this.update = function(){
        this.y -= this.yVol;
        if(this.y < 200 + Math.floor(Math.random() * 10)){
            this.boom = true;

            for(var i = 0; i < 40; i++){
                var radius = Math.floor(Math.random() * 8);
                var volXSwitch = Math.floor(Math.random() * 2);
                var volYSwitch = Math.floor(Math.random() * 2);
                var vol = {x: undefined, y: undefined};
                if(volXSwitch == 0){
                    vol.x = Math.floor(Math.random() * 5) + 2;
                } else {
                    vol.x = Math.floor(Math.random() * -5) + -2;
                }
                if(volYSwitch == 0){
                    vol.y = Math.floor(Math.random() * 7) + 1.5;
                } else {
                    vol.y = Math.floor(Math.random() * -7) + -1.5;
                }
                var yVol = (Math.random() * 3) + 2.5;
                smokeArray.push(new SmokeCircle(
                    this.x,
                    this.y,
                    radius,
                    vol.x,
                    vol.y,
                    1,
                    this.R,
                    this.G,
                    this.B
                    ));
            }
            rocketArray.push(new Rocket(
                Math.random() * canvas.width,
                canvas.height,
                (Math.random() * 2) + 3,
                (Math.random() * 5) + 5,
                (Math.random() * 6) + 4,
                Math.floor(Math.random() * 255),
                Math.floor(Math.random() * 255),
                Math.floor(Math.random() * 255)

            ));
        }
        this.draw();
    }
    this.update();
}


